import axios from "axios";

const API_URL = "http://localhost:5000/api/colleges";

export const getCollegesByRank = async (rank) => {
    try {
        const response = await axios.get(`${API_URL}?rank=${rank}`);
        console.log("API Response:", response.data); // Debug log
        return response.data;
    } catch (error) {
        console.error("Error in API call:", error.response || error.message);
        throw error;
    }
};
